    return (
        <div className="modal">
            <div className="modal-content">
            <p>Modal</p>

            <Button onClick={closeModal}>
                Close
            </Button>
            </div>
        </div>
    );
};

Modal.propTypes = {
    closeModal: PropTypes.func
};

export default Modal;
